import React from 'react';

function ContactUs() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>
                    Contact Us
                </h1>
            </header>
            <body className= "App-info">
                <h2>Interested in joining DayDream Magazine?</h2>
            </body>
        </div>
    );
}

export default ContactUs;
